INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220177238', 'Poulet au curry et riz basmati', 'Riz basmati cuisiné 43.3% : riz basmati cuit 37% (eau, riz basmati), courgette, oignon préfrit (oignon, huile de tournesol), huile de tournesol, poivre, sel. Sauce au curry 40% : eau, jus de pomme à base de concentré, CREME fraîche (France) 4%, oignon, amidon de maïs, arôme naturel (contient LAIT), préparation culinaire tikka massala (mélange d\'épices et de plantes aromatiques, eau, huile de colza, pâte de tomate, sel, vinaigre d\'alcool, sucre, oignon en poudre, noix de coco en poudre, farine de maïs, jus de citron concentré), LAIT entier en poudre, huile de tournesol, raisin sec 0.4% (raisin sec, agent d\'enrobage : huile de coton), ail en purée, curry 0,1%, coriandre 0.09%, paprika, sel, poivre. Morceau de filet de poulet traité en salaison rôti 16.7% : filet de poulet (Pologne) 14%, eau, amidon de tapioca, dextrose, sel.', 'https://static.openfoodfacts.org/images/products/325/622/017/7238/front.23.400.jpg', '3.5', '1.4', '14.6', '1.3', '1', '6.5', '0.46', '0.181102362204724', '', '1');

