VALUES ('3256220177245', 'Colin d\'Alaska riz et petits légumes', 'Riz cuit et légumes 52% : Riz cuit 30% (eau, riz, sel), légumes 22% [p, etit pois 4,8%, chou-fleur (France) 4,4%, brocoli 4,4%, carotte 4,2%,, courgette 4,2%]. Sauce au citron 26,7% : Riz cuit et légumes 52% : Riz, cuit 30% (eau, riz, sel), légumes 22% [petit pois 4,8%, chou-fleur (F, rance) 4,4%, brocoli 4,4%, carotte 4,2%, courgette 4,2%]. Eau, crème f, raîche (France) 7%, échalote 1%, beurre, jus de citron 0,7%, amidon tr, ansformé de riz, fumet de poisson aromatisé [maltodextrine, sel, farin, e de blé, poisson en poudre, sucre, légumes (oignon, poireau, céleri),, crème en poudre, extrait de levure, huile d\'olive, arôme naturel (con, tient crustacés et poissons), lactose, poudre et extrait de crevette,, épice et aromates, extrait de vin blanc, graine de céleri], vin blanc, concentré, sel, curcuma 0,008%. Colin d\'Alaska (poisson) 21,3% : (The, ragra chalcogramma, pêché en Pacifique nord-est ou nord-ouest). Cert, ains ingrédients de ce produit ne proviennent pas de France.', '', '3.7', '2.5', '9.7', '0.6', '0.9', '5.1', '0.54', '0.21259842519685', '', '1');

