VALUES ('3256220358026', 'Paëlla aux fruits de mer, aiguillettes de poulet, colin d\'Alaska et chorizo', 'Riz cuit au curcuma 47% (eau, riz, curcuma), eau, morceau de filet de poulet traité en salaison rôti 7% [filet de poulet (origine : Pologne) 5%, eau, amidon de tapioca, dextrose, sel], COLIN d\'Alaska (Theragra chalcogramma, pêché en Pacifique nord-est ou nord-ouest) 5%, petit pois 4%, anneau de CALMAR (Loligo chinensis, vulgaris ou duvauceli, pêché en Pacifique centre-ouest ou Océan Indien est ou ouest) 4%, MOULE du Pacifique décoquillée cuite (Mytilus chilensis, élevée au Chili) 4%, crevette décortiquée cuite 4% [CREVETTE (Heterocarpus spp, Parapenaeopsis spp , Penaeus ssp, Solenocera spp, pêchée en Océan Indien est ou ouest) 3%, eau, sel], poivron rouge préfrit 3% (poivron, huile de tournesol), chorizo 2% [viande et gras de porc (origine : France), piment doux, LACTOSE, sel, dextrose, épices, antioxydant : ascorbate de sodium, ferments], poivron vert 2%, oignon, poivron jaune 1%, huile de tournesol, purée de tomate double concentrée, arômes naturels (contient CRUSTACES et LAIT), ail 0, 4%, huile d\'olive vierge extra 0, 4%, oignon en poudre, sel, assaisonnement (sel, amidon de pomme de terre, épices, sucre, extrait d\'épice, oignon), paprika, amidon de maïs, curcuma 0, 01%, poivre. Soit 72% de riz cuit cuisiné dans le produit.', 'https://static.openfoodfacts.org/images/products/325/622/035/8026/front.7.400.jpg', '3.2', '0.64', '15.8', '0.2', '0.9', '7.1', '0.7', '0.275590551181102', '', '1');

