VALUES ('3256220365550', 'Craquants aux céréales', 'Sucre, raisins de Corinthe 14% (raisins de Corinthe,huile de colza), graines de tournesol 12%,CACAHUETES 11%, sirop de glucose, GRAINES DE SESAME 11%, flocons d\'AVOINE 9%, BEURRE,NOISETTES 3%, miel, émulsifiant : lécithine detournesol, LAIT entier en poudre.Traces éventuelles d\'oeuf, soja, etautres fruits à coque.', '', '29.3', '6.8', '45.6', '32.6', '8.2', '10.2', '0.1', '0.0393700787401575', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220365796', 'Profiteroles', 'Chou fourré de crème glacée à la vanille (180g) : eau, OEUF entier, sucre, farine de BLE, grain de sucre, BEURRE concentré, LACTOSE et PROTEINES de LAIT, huile de tournesol, sirop de glucose, LAIT écrémé en poudre, arôme naturel de vanille, émulsifiant : mono et diglycérides d\'acides gras, stabilisants : farine de graine de caroube, gomme guar et carraghénanes ; fibre de betterave, poudre à lever : diphosphates, sel, colorants : curcumine, lutéine et extrait de paprika (contient LAIT) ; gousse de vanille épuisée 0.03%. Sauce au chocolat (2x50g) : eau, sucre, chocolat noir 5% (pâte de cacao, sucre, émulsifiant : phosphatides d\'ammonium, arôme naturel de vanille), cacao en poudre, CREME fraîche, sirop de glucose-fructose, émulsifiant : mono et diglycérides d\'acides gras, gélifiant : carraghénanes. Pourcentages exprimés sur le produit fini. Traces éventuelles de fruits à coque, graines de sésame et soja.', 'https://static.openfoodfacts.org/images/products/325/622/036/5796/front.17.400.jpg', '14', '6', '29', '21', '2.9', '4.8', '0.4', '0.15748031496063', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220365802', 'Buche Van / Noug / FRTS Rges U 1L', 'Sorbet fruits rouges 382% : eau, purée de fruits rouges 35%* sirop de glucose-fructose, sucre, jus concentré de sureau, colorant : rouge de betterave, gélifiants : pectines - gomme tara - gomme xanthane, correcteur d\'acidité : acide citrique, protéines de pois hydrolysées, arôme naturel. *Pourcentage exprimé sur le sorbet fruits rouges. Crème glacée à la vanille 31.1 % : eau, lait écrémé réhydraté, crème, sirop de glucose-fruc- tose, sucre, lactose et protéines de lait, sirop de glucose, arôme naturel de vanille, émulsifiant : mono et diglycérides diacides gras, gélifiants : farine de graines de caroube - gomme guar. *Pourcentage exprimé sur la crème glacée à la vanille. Crème glacée au nougat avec des inclusions de morceaux de nougat noir 29,2% : lait écrémé réhydraté, crème, eau, sucre, morceaux de nougat noir 8,2%* [amandes grillées 34%, sirop de glucose, sucre, graisse végétale de noix de coco, pain azyme (fécule de pomme de terre, eau, huile végétale de tournesol), colorant : caramel ordinaire, agent d\'enrobage : cire de carnauba], sirop de glucose, crème de nougat 4.5%* (amandes 70%, sirop de glucose, miel, sucre, blanc dlœuf, arôme naturel de vanille), lactose et protéines de lait, arôme naturel (contient noisette), émulsifiants : mono et diglycérides d\'acides gras - esters lactiques des mono et diglycérides diacides gras, gélifiants : farine de graines de caroube - gomme guar - carraghénanes, extrait de miel. *Pourcentages exprimés sur la crème glacée au nougat avec des inclusions de morceaux de nougat noir. Morceaux de pistaches grillées 0,5% Pépites à la framboise 0,5% : purée de framboise 32%*, sucre, pomme, dextrose, fibres d\'ananas, gélifiant : alginate de sodium, stabilisant : orthophosphates de calcium, colorants : anthocyanes et curcumine, arôme, correcteur d\'acidité : acide citrique. *Pourcentage exprimé sur les pépites à la framboise. Plaquette de chocolat 0,5% : pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, carbonate de calcium - oxyde et hydroxyde de fer. Traces éventuelles de gluten, d\'arachides, soja et autres fruits à coque.', '', '6.8', '3.7', '25.1', '22.7', '1.1', '1.8', '0.1', '0.0393700787401575', '', '0');

