ré de citron jaune, correcteur d\'acidité : acide citrique, eau, pulpe de citron jaune, sucre, citron jaune), ciboulette, sel, poivre noir.*Pourcentages exprimés sur la tartelette.6 mini-tartelettes aux deux fromages 24,6% : Pâte brisée** 51,4%, garniture 48,6% [eau, EMMENTAL râpé 12,7%*, OEUF entier liquide, LAIT écrémé en poudre, amidon transformé de pomme de terre, PARMESAN râpé 0,9%*, sel, arôme]. *Pourcentages exprimés sur la tartelette.**Pâte brisée : farine de BLE, huile de tournesol, eau, BEURRE, amidon de BLE, sel, LACTOSERUM et protéines de LAIT, sucre, poudres à lever : diphosphates et carbonates de sodium (céréales contenant du GLUTEN). Traces éventuelles de moutarde, céleri, mollusques, crustacés, fruits à coque et soja.', '', '20.9', '5', '40.8', '2.6', '1.5', '10.6', '1.13', '0.444881889763779', '', '0');

